import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "mohib"
    };
  }

  render(){
    return (
      <div style={{textAlign:"center"}}>
        <p>{this.state.name}</p>
        <button type="button"
          onClick={() => this.setState({name: "MOHIB"})}>UPPERCASE</button>
      </div>
    );
  }
}

export default App;
